import React from "react";

const MasonryPost = ({ post, tagsOnTop }) => {
    const style = {backgroundImage: `url("${require(`../../assets/imgs/${post.image}`)}")`}
  return <a className="masonry-post overlay" style={style} href={post.link}></a>;
};

export default MasonryPost;
